literals:
".App {
    width: 100%;
    box-sizing: border-box;
    padding: 0 100px 0 100px;
    margin: 0;
}

@media (max-width: 768px) {
    .App {
        padding: 0;
    }
}

::-webkit-scrollbar {
    width: 0;
  }

.text {
    font-family: Helvetica;
    font-weight: bold;
    font-size: 18px;
}

.text:first-of-type {
    margin-top: 25px;
}"

".Carousel {
    position: relative;
    box-sizing: border-box;
    width: 100%;
    height: max-content;
    display: flex;
    flex-wrap: nowrap;
    flex-direction: column;
    overflow: hidden;
    padding: 0 0 60px 0;
    margin: 50px 0;
}"

".CarouselButton {
    position: absolute;
    width: 40px;
    height: 40px;
    top: calc(50% - 50px);
    background-color: black;
    border-radius: 50%;
    border: none;
    z-index: 10;
    cursor: pointer;
    color: white;
    font-size: 25px;
    padding: 0;
    text-align: center;
    outline: none;
    -webkit-tap-highlight-color: rgba(255, 255, 255, 0);
    -webkit-tap-highlight-color: transparent;
    transition: opacity .3s linear;
}

.CarouselButton_previous {
    left: 10px;
}

.CarouselButton_next {
    right: 10px;
}

.CarouselButton_unactive {
    opacity: .3;
    transition: opacity .3s linear;
}"

".CarouselContent {
    position: relative;
    display: grid;
    grid-template-rows: 1fr;
    gap: 0px 0px;
    height: auto;
}

"

".CarouselPageLink {
    width: 20px;
    height: 20px;
    background-color: black;
    border-radius: 50%;
    border: none;
    z-index: 11;
    margin: 0 10px 0 0;
    color: white;
    cursor: pointer;
    padding: 0;

    text-align: center;
    font-size: 12px;

    outline: none;
    -webkit-tap-highlight-color: rgba(255, 255, 255, 0);
    -webkit-tap-highlight-color: transparent;

}

.CarouselPageLink:last-of-type {
    margin-right: 0
}"

".CarouselPagination {
    position: absolute;
    bottom: 20px;
    display: flex;
    justify-content: center;
    width: 100%;
    z-index: 11;
}"

".anyClassName {
    width: 100%;
    height: 150px;
    background-color: red;
    color: white;
    font-size: 50px;
    text-align: center;
    font-family: Helvetica;
    font-weight: bold;
    padding: 40px 0;
    box-sizing: border-box;
    border-radius: 20px;
}"
